import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import '../App.css';


// Navbar class of navigation bar
export default class Navbar extends Component {
    
    render() {
        const token = localStorage.getItem("token");
  const logout = () => {
    localStorage.removeItem("token");
  };
        return (
            <div className="nav-container">
                <nav className="navbar">
                <Link to="/" ><img className="logo"src={require('../Media/logo-falcon.png')}></img></Link>
                {/*if you want to add a button on the right of navbar <span className="applybtn" ></span> */}
                </nav>    
               
                {!token ? (
        <div className="nav-buttons">
          <Link to="/login">
            <button className="log-in">Log in</button>
          </Link>
          <Link to="/inscription">
            <button className="sign-up">sign up</button>
          </Link>
        </div>
      ) : (
        <Link className="nav-home-display " to="/">
          <div className="nav-home">
            <Link to="/search">
              <button className="search">search</button>
            </Link>
            <Link to="/users">
              <button className="search">Profile</button>
            </Link>
            <button className="logout" onClick={logout}>
              Log out
            </button>
          </div>
        </Link>
      )}
                       
            </div>
        )
    }
}
